import {Component} from 'react'

import Header from '../Header'

class Home extends Component {
  state = {data: []}

  componentDidMount() {
    this.getData()
  }

  getData = async () => {
    const answer = await fetch('http://localhost:3001')
    if (answer.ok) {
      const data = await answer.json()
      this.setState({data: data})
    }
  }

  render() {
    return (
      <div>
        <Header />
      </div>
    )
  }
}

export default Home
